import React from "react";
import ReactDOM from "react-dom/client";
import { createBrowserRouter, RouterProvider } from "react-router-dom";
import "./reset.css";

//bootstrap 사용
import "bootstrap/dist/css/bootstrap.css";
import "bootstrap/dist/css/bootstrap.min.css";

//layout
import CusLayout from "./layout/CusLayout";
import ManagerLayout from "./layout/ManagerLayout";

//page 연결
import NotFound from "./pages/NotFound";

import LoginPage from "./pages/LoginPage";

import CusMainPage from "./pages/cus/CusMainPage";
import CusOrderPage from "./pages/cus/CusOrderPage";
import CusAsPage from "./pages/cus/CusAsPage";
import CusTalkPage from "./pages/cus/CusTalkPage";

import ManMainPage from "./pages/man/ManMainPage";
import ManCusPage from "./pages/man/ManCusPage";
import ManAsPage from "./pages/man/ManAsPage";
import ManTalkPage from "./pages/man/ManTalkPage";
import ManCalllistPage from "./pages/man/ManCalllistPage";
import ManCallmissPage from "./pages/man/ManCallmissPage";
import ManCallonePage from "./pages/man/ManCallonePage";
import ManCallDetailsPage from "./pages/man/ManCallDetailsPage";
import ManScriptPage from "./pages/man/ManScriptPage";

const router = createBrowserRouter([
  {
    path: "/",
    element: <CusLayout />,
    errorElement: <NotFound />,
    children: [
      { index: true, element: <CusMainPage /> },
      { path: "order", element: <CusOrderPage /> },
      { path: "as", element: <CusAsPage /> },
      { path: "talk", element: <CusTalkPage /> },
      { path: "login", element: <LoginPage /> },
    ],
  },
  {
    path: "/manager",
    element: <ManagerLayout />,
    errorElement: <NotFound />,
    children: [
      { index: true, element: <ManMainPage /> },
      { path: "cus", element: <ManCusPage /> },
      { path: "as", element: <ManAsPage /> },
      { path: "talk", element: <ManTalkPage /> },
      { path: "calllist", element: <ManCalllistPage /> },
      { path: "calllist/call/:id", element: <ManCallDetailsPage /> },
      { path: "calllist/call/:id/script", element: <ManScriptPage /> },
      { path: "callmiss", element: <ManCallmissPage /> },
      { path: "callone", element: <ManCallonePage /> },
    ],
  },
]);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
